Siguiendo con Anish Kapoor, arista indo-británico. La Cloud Gate , también llamado The Bean. La primera obra al aire libre instalada por el artista en los Estados  Unidos, inspirada en Mercurio liquido, forjada en perfectas placas de acero inoxidable súper pulidas, permite reflejar el famoso horizonte de los edificios de Chicago y las nubes de arriba. Un arco proporciona una puerta a su interior permitiéndonos  vivencias  de imágenes en infinitas perspectivas. Pesa 110 toneladas y está ubicada en Millenium Park en el centro de Chicago. Septiembre 2018
